class Helado {
    constructor(id, imagen, nombre, enStock) {
      this.id = id;
      this.imagen = imagen;
      this.nombre = nombre;
      this.enStock = enStock;
    }

    /* Getters */
    get id() {this.id};
    get imagen() {this.imagen};
    get nombre() {this.nombre};
    get enStock() {this.ienStockd};
}



export default Helado;
